export default class AdminPage extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <ul className="list-group">
          {this.props.allItems.map((item) => {
            return (<li className="list-group-item">  <img src={item.imgsrc} /> <br/> id:{item.id} <br/> {item.title} <br/> Price : {item.price}$
          <br/> <input type="number"/>
            <button>Change Price</button>
            <br/>  <button>remove Item</button>
            </li>
            
            )

          })}
        </ul>
      </div>
    );
  }
}
